import { useNavigation } from "@react-navigation/native";
import { StatusBar } from "expo-status-bar";
import React, { Component, useEffect, useState } from "react";
import {
  Text,
  StyleSheet,
  View,
  ScrollView,
  SafeAreaView,
  TouchableOpacity,
  Image,
  TouchableWithoutFeedback,
} from "react-native";
import { ChevronLeftIcon, HeartIcon } from "react-native-heroicons/outline";
import { fetchPersonDetails, img342 } from "../api/moviesDb";

export default function PersonScreen({ route }) {
  const { person } = route.params;
  const [personDetails, setPersonDetails] = useState();
  useEffect(() => {
    getPersonDetails(person.id);
  }, [person]);
  const navigation = useNavigation();
  const getPersonDetails = async (id) => {
    const data = await fetchPersonDetails(id);
    if (data) setPersonDetails(data);
  };
  const [isFavorite, setIsFavorite] = useState(false);
  const [visible, setVisible] = useState(false);
  return (
    <ScrollView style={{ backgroundColor: "rgb(233, 241, 249)" }}>
      <StatusBar translucent={true} />
      <View
        style={{
          flexDirection: "row",
          alignItems: "center",
          justifyContent: "space-between",
          paddingHorizontal: 20,
          width: "100%",
          marginTop: 40,
        }}
      >
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <ChevronLeftIcon size={22} color="#222" strokeWidth={2.3} />
        </TouchableOpacity>
        <TouchableOpacity
          onPress={() => {
            setIsFavorite(!isFavorite);
          }}
        >
          <HeartIcon
            size={24}
            color={isFavorite ? "tomato" : "#111"}
            strokeWidth={2.3}
          />
        </TouchableOpacity>
      </View>
      <View
        style={{
          alignItems: "center",
        }}
      >
        <TouchableWithoutFeedback
          style={{ elevation: 20 }}
          onPress={() => setVisible(!visible)}
        >
          <Image
            source={{ uri: img342(person?.profile_path) }}
            style={{
              width: 200,
              height: 200,
              borderRadius: 160,
              marginTop: 40,
              borderWidth: 4,
              borderColor: "#eee",
            }}
          />
        </TouchableWithoutFeedback>
        <View style={{ marginTop: 20, alignItems: "center" }}>
          <Text style={{ fontSize: 22, fontWeight: "900" }}>
            {person?.name}
          </Text>
          <Text style={{ fontSize: 12, fontWeight: "600", opacity: 0.4 }}>
            {personDetails?.place_of_birth}
          </Text>
        </View>
        <View style={styles.userDetails}>
          <View style={styles.item}>
            <Text style={{ fontSize: 12, fontWeight: "700" }}>Gender</Text>
            <Text style={{ fontSize: 10, fontWeight: "600", opacity: 0.4 }}>
              {personDetails?.gender === 1 ? "Female" : "Male"}
            </Text>
          </View>
          <View style={styles.item}>
            <Text style={{ fontSize: 12, fontWeight: "700" }}>Birthday</Text>
            <Text style={{ fontSize: 10, fontWeight: "600", opacity: 0.4 }}>
              {personDetails?.birthday}
            </Text>
          </View>
          <View style={styles.item}>
            <Text style={{ fontSize: 12, fontWeight: "700" }}>Known for</Text>
            <Text style={{ fontSize: 10, fontWeight: "600", opacity: 0.4 }}>
              {personDetails?.known_for_department}
            </Text>
          </View>
          <View style={[styles.item, { borderRightWidth: 0 }]}>
            <Text style={{ fontSize: 12, fontWeight: "700" }}>Popularity</Text>
            <Text style={{ fontSize: 10, fontWeight: "600", opacity: 0.4 }}>
              {personDetails?.popularity}
            </Text>
          </View>
        </View>
      </View>
      <View style={{ paddingHorizontal: 20, marginTop: 10 }}>
        <Text style={{ fontWeight: "900", fontSize: 22 }}>Biography</Text>
        <Text style={{ marginTop: 10 }}>
          {personDetails?.biography === ""
            ? "No biography"
            : personDetails?.biography}
        </Text>
      </View>
      <View style={{ paddingHorizontal: 20, marginTop: 10 }}>
        <Text style={{ fontWeight: "900", fontSize: 22 }}>Other names</Text>
        {personDetails?.also_known_as.length > 0 ? (
          <Text style={{ marginTop: 10 }}>
            {personDetails?.also_known_as.map((item) => (
              <Text key={item} style={{ fontWeight: "800" }}>
                {item},{" "}
              </Text>
            ))}
          </Text>
        ) : (
          ""
        )}
        {/* <Dialog onDismiss={() => setVisible(!visible)}></Dialog> */}
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  userDetails: {
    marginTop: 20,
    alignItems: "center",
    width: "90%",
    justifyContent: "space-around",
    paddingVertical: 10,
    backgroundColor: "#fff",
    borderRadius: 50,
    flexDirection: "row",
    paddingHorizontal: 20,
  },
  item: {
    alignItems: "center",
    borderRightColor: "#ddd",
    borderRightWidth: 1,
    width: "25%",
  },
});
